  "text" : "\"\uC545\uB784\uD568\uC744 \uBCF4\uC5EC\uC8FC\uB294 \uB300\uBAA9\uB3C4 \uC788\uC5C8\uC2B5\uB2C8\uB2E4. \uBC15 \uC528\uC5D0 \uB300\uD574 \uC548 \uC88B\uC740 \uC774\uC57C\uAE30\uB97C \uD558\uB294 \uD559\uC0DD\uC744 \uACE0\uC790\uC9C8\uD558\uBA74 \uACE7\uBC14\uB85C \uCD5C\uACE0 \uB4F1\uAE09\uC73C\uB85C \uC62C\uB824\uC92C\uC2B5\uB2C8\uB2E4. \uC5B4\uB9B0\uC774\uB4E4\uC774 \uC11C\uB85C\uB97C \uAC10\uC2DC\uD574 \uC790\uC2E0\uC758 \uD559\uB300\uAC00 \uBC16\uC73C\uB85C \uB4DC\uB7EC\uB098\uC9C0 \uC54A\uAC8C \uD55C \uAC81\uB2C8\uB2E4. \uC544\uC774\uB4E4\uC740 \uC11C\uB85C\uAC00 \uC11C\uB85C\uB97C \uAC10\uC2DC\uD574\uC57C \uD588\uC2B5\uB2C8\uB2E4.\"",
